import Link from "next/link";
import { useRouter } from "next/router";
import { Nav, Navbar } from "react-bootstrap";
import Router from "next/router";
import Head from 'ne'
const handleClickIndex = () => Router.push({ pathname: "/" });
const routes = [
  // { href: "/", label: "Home" },
  { href: "/about", label: "Technology" },
  { href: "/contact", label: "Design" },
  { href: "/contact", label: "Solution" },
  { href: "/contact", label: "Team" },
  { href: "/contact", label: "Contact" },
];
function Header() {
  const router = useRouter();

  return (
    <>
     <Head>
        <title>AST</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>
      <Navbar sticky="top" bg="light" variant="light">
        <Nav className="container flex nav-fill flex-wrap flex-sm-row mr-auto">
          <Navbar.Brand>
            <a onClick={() => handleClickIndex()}>
              <img src="/ast-logo.png" alt="AST" width="50" height="40" />
            </a>
          </Navbar.Brand>

          <Navbar className="nav-right text-uppercase ">
            {routes.map((route) => (
              <li key={route.label}>
                <Link href={route.href}>
                  <a
                    className={`px-3 ${
                      router.pathname = route.href ? "text-dark " : ""
                    }`}
                  >
                    {route.label}
                  </a>
                </Link>
              </li>
            ))}
          </Navbar>
        </Nav>
      </Navbar>

    </>
  );
}

export default Header;
